import React from "react";
import ReactDOM from "react-dom";
import  "./index.css";


const im2 = "https://assets.stickpng.com/images/59060d740cbeef0acff9a660.png"



ReactDOM.render(
<>
<h1 className="heading"> Muhammad Zaeem </h1>
<p className="heading">Here is My youtube Channel</p>
<div className="imgdiv">
<img src={im2} />
</div>
</>,
document.getElementById("root")
);
